import './App.css';
import { Feed } from './components/Feed';
import { Navbar } from './components/Navbar';
import { Rightbar } from './components/Rightbar';
import { Sidebar } from './components/Sidebar';
import { Cards } from './components/Cards';
import { Button, ButtonGroup, Grid } from '@mui/material';
import { Home, WidthNormal } from '@mui/icons-material';
import styled from '@emotion/styled';
import SignUp from './sayfalar/SignUp';
import { Route, Routes } from 'react-router-dom';

function App() {
  const OrangeButton= styled(Button)(({theme})=>({
    backgroundColor:theme.palette.secondary.main,
    color:"#f27a1a",
    marginTop:"100px",
    "&:hover":{
      backgroundColor:"white"
    },
  }));
  return (
    <div className='ana_sayfa' >
      <Routes>
        <Route path='/' element={<home/>}/>
        <Route path='/giris' element={<SignUp/>}/>
      </Routes>
      <Navbar />
      <ButtonGroup>
      <Grid>
        <OrangeButton
        variant='contained' 

        sx={{ marginTop: "100px", marginLeft: "100px", width:400,height:50 }}>
          <h3>Sepete En Çok Eklenenler</h3>
        </OrangeButton>
      </Grid>
      <Grid>
        <OrangeButton
        variant='contained'
        sx={{ marginTop: "100px", marginLeft: "30px",width:400,height:50 }}>
          <h3>En Çok Öne Çıkanlar</h3>
        </OrangeButton>
      </Grid>
      <Grid>
        <OrangeButton
        variant='contained'
        sx={{ marginTop: "100px", marginLeft: "30px",marginRight:"100px",width:400,height:50 }}>
        <h3>Flaş Ürünler</h3>
        </OrangeButton>
      </Grid>
      </ButtonGroup>

      <Grid container>
        <Feed />
      </Grid>

    </div>
  );
}

export default App;
